import React from 'react';
import styled from 'styled-components';
import {Link} from 'react-router-dom';

const Nav = styled.div`
    background: #15171c;
    height: 80px;
`;

const Sidebar = () => {
    return (
        <>
        <Nav>Nav</Nav>
        </>
    )
}

export default Sidebar
